After setting everything up, I made a script that uses a pipeline to download a zip file, unpack it, grab the XLS file inside and convert the content to JSON (so I can manage it in my code/database). Everything works very well except when I am uploading every JSON part into MongoDB, the download speed decreases exponentially, and seems like the query is blocking the event loop.
I had the idea to use <code>Promise.all()</code> to optimize my queries but the problem with it is that the array will grow a lot ending up in a memory exception (doing checks for array size on every data callback may also add further overhead to the execution).
That's my code:</p>
<pre><code>const updateCatalog = async () =&gt; {
server.log.info('Updating catalog...');
const progressBar = new cliProgress.SingleBar({}, cliProgress.Presets.shades_classic);

const parser = Papa.parse(NODE_STREAM_INPUT, {
    header: false,
    fastMode: true
});

const database = client.db('bonnie');
const collection = database.collection('catalog');

progress(request(ZIP_URI)).on('progress', (state: RequestProgressState) =&gt; {
    progressBar.update(Math.floor(state.percent * 100));
}).on('response', () =&gt; progressBar.start(100, 0))
    .pipe(unzip.Parse())
    .on('entry', (entry: unzip.Entry) =&gt; {
        entry.pipe(parser).on('data', async (data: Array&lt;string&gt;) =&gt; {
            await collection.insertOne({
                embedUrl: data[0],
                thumbnailUrl: data[1],
                thumbnailUrls: data[2].split(';'),
                title: data[3],
                tags: data[4].split(';'),
                categories: data[5].split(';'),
                authors: data[6].split(';'),
                duration: parseInt(data[7]) ?? 0,
                views: parseInt(data[8]) ?? 0,
                likes: parseInt(data[9]) ?? 0,
                dislikes: parseInt(data[10]),
                thumbnailHdUrl: data[11],
                thumbnailHdUrls: data[12].split(';')
            }); 
        }).on('end', () =&gt; {
            progressBar.stop();
            server.log.info('Catalog updated');
        }).on('error', (err: any) =&gt; { client.close(); }); 
});
}
</code></pre>
<p>The same issue with memory exception will obviously happen with mongo Bulks too.</p>

