<pre><code>    const handleSearch = async (e) =&gt; {
        const product = {search}

        const response = await fetch('/api/products/search', {
            body: JSON.stringify(product),
            headers: {
                'Content-Type': 'application/json'
            } 
        })

</code></pre>
