Parsing of collection validator failed :: caused by :: Unknown $jsonSchema keyword: examples in MongoDB/Ajv/Typebox<p>I'm using an <strong>Atlas</strong> based mongodb instance and fastify for backend. I'm also using @sinclair/<strong>typebox</strong> to generate JSON Schemas for data validation. Normally, I use these schemas to <strong>validate input messages</strong> but I now want to <strong>reuse them as validators for MongoDB</strong> collections too.</p>
<p>I have something like this:</p>
<pre class="lang-js prettyprint-override"><code>    await database.command({
      collMod: 'users',
      validator: {
        $jsonSchema: UserSchema,
      },
    });
</code></pre>
<p>And also, I have examples set for some of the fields. e.g.:</p>
<pre class="lang-js prettyprint-override"><code>export const HandleSchema = Type.RegEx(/^[a-zA-Z0-9_-]{1,24}$/, {
  examples: ['harry-potter', 'jane-doe-99'],
  title: 'Handle',
  // ...
});

export const UserSchema = Type.Object(
  {
    _id: HandleSchema,
    // ...
  },
  { additionalProperties: false },
);

</code></pre>
<p>However, I'm getting this error while trying to apply this validator:</p>
<blockquote>
<p>Parsing of collection validator failed :: caused by :: Unknown $jsonSchema keyword: examples</p>
</blockquote>
<p>Which means the <code>examples</code> keyword is not recognized by MongoDB; and unfortunately looks like this happens in server side. Looks like they <a href="https://jira.mongodb.org/browse/SERVER-30723" rel="nofollow noreferrer">dared to ignore</a> the behavior suggested by the spec. I'm also seeing a flag that can be used to <a href="https://github.com/mongodb/mongo/commit/ce71ccd92747972654c92fe9438df9c633188f93#diff-5732722664308f17bd3b2815eb7a3929edd874d33b3cbdeddf6ab7a7216a306a" rel="nofollow noreferrer">ignore unknown keywords</a>, but unfortunately, <code>setParameter</code> <a href="https://www.mongodb.com/docs/atlas/unsupported-commands/#unsupported-commands-1" rel="nofollow noreferrer">doesn't work with atlas</a>.</p>
<p>Now, at least I should be able to remove <code>examples</code> somehow from typebox or ajv. I tried <code>Type.Strict(UserSchema)</code> and <code>ajv.customOptions.keywords</code> set to <code>['examples']</code> (this probably is the inverse of what I want to achieve), but they didn't work.</p>
<p>How do I ignore <code>examples</code> field just for the mongodb schema? Or how do I fix this from MongoDB Atlas side (looks impossible)? Any other approach?</p>
<p>Thanks in advance.</p>

